import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Aplikacija za lov</h1>
        <div className="Menu">
          <Link className="Button" to="/popis-lovaca">EVIDENCIJA LOVACA</Link>
          <Link className="Button" to="/raspored-aktivnosti">RASPORED AKTIVNOSTI I LOVA</Link>
          <Link className="Button" to="/popis-lovaca">EVIDENCIJA PRISUTNOSTI NA LOVNI DAN</Link>
          <Link className="Button" to="/unos-divljaci">UNOS DIVLJAČI</Link>
          <Link className="Button" to="/unos-ostrijela">UNOS ODSTRIJELENE DIVLJAČI</Link>
          <Link className="Button" to="/popis-bodova">BODOVI</Link>
        </div>
      </header>
    </div>
  );
}

export default App;
